  console.log("mode : ", mode);

  return (
    <div>
      <h1>Edit</h1>
      <p>이곳은 일기 수정 페이지</p>
      <butto onClick={() => setSearchParams({ who: "winter" })}></butto>
    </div>
  );
};

export default Edit;
